/**
 * Stylesheet for the Trophy component.
 * 
 * Authors: Emily
 */

import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    // Style the TextField component
    trophy_img: {
        width: 75,
        height: 75,
        alignSelf: 'center',
    },
    lock: {
        width: 75,
        height: 75,
        alignSelf: 'center',
    }
});
